d/photos/2021/10/mjxZ35E1FD3mv4ozYBjV_21_26396e06c9d00d2a39980500622a7d77_image.jpg', 135, 0, 'Latest drop Nike Air Force 1 Low Wraps Up by Black Twill Paisley', '1'),
(10, 39485, 'Where to Buy Cheap Nike SB Dunk High Strawberry Cough', '&lt;p&gt;The long-awaited Nike SB dunk drops are finally ready to be released to the public, as &lt;a href=&quot;https://www.cadysneaker.com&quot;&gt;&lt;strong&gt;Cadysneaker&lt;/strong&gt;&lt;/a&gt; are approaching the official release date of Nike SB dunk high &quot;Strawberry Cough&quot;. Todd Bratruds memorable 2011 &quot;Skunk Dunk&quot; design, &quot;Strawberry Cough&quot;, inspired by its unique strain cannabis, has some special extras like leaf-inspired, velvet earmuffs, and a The secret hides the tongue in the pocket, and the specially designed strawberry insole and embroidered heel. These initially surfaced in 2020, and there are rumors that they will be completely scrapped. Samples and early leaked pairs require extremely high quantities in the aftermarket. The fall in retail prices this week will surely cool these prices to a more affordable figure.&lt;/p&gt;&lt;p&gt;Since joining Reebok in an official capacity, Kerby Jean-Raymond &lt;a href=&quot;https://www.2021shoes.com&quot;&gt;&lt;strong&gt;2021Shoes&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt; &lt;/strong&gt;has taken a step back from his collaborative work and chose to make Pyer Moss&#039;s first independent shoe . But soon, after an interruption for nearly a year, the two began a new experiment 4 &quot;Emergency&quot; (Emergency) cooperation. As its name implies, the color draws utilitarian inspiration from the surfaceespecially found in the equipment of the rescue team. The sturdy orange leather is applied to the shoes, wearing eye stays, lace shields, and swinging adjacent. In other places, the buildings are much lower-key, replaced by all gray. This neutral run is inserted throughout the grid, midsole, tread, and heel, surrounded by black lining.&lt;/p&gt;&lt;p&gt;With the &quot;Rawdacious&quot; and Team USA color matching that debuted at the 2021 Olympics, &lt;a href=&quot;https://www.sneakerheads2020.com&quot;&gt;&lt;strong&gt;Sneakerheads2020&lt;/strong&gt;&lt;/a&gt; the Zoom GT Run is positioned as a common sight for Nike athletes in the NBA season from 2021 to 2022. Already appearing in a variety of PE color schemes, Zoom GT Run is exploring its lifestyle-friendly side, because we have seen some atypical color schemes, such as &quot;tie-dye&quot; patterns. This upcoming drop obviously reminds us of the iconic ACG Air Mowabb, another flex of the Nike basketball color team, because it uses a combination of rattan, blue, and orange to achieve the timeless gear aesthetics in all conditions. Adding to the mix is a light green accent on the top hole, a swish of the front toes, and a label with the letters on the heel, and a light yellow barrier above the midsole. So, although these are not true Mowab tributes, it is difficult to ignore its existence in this color, and it brings us back to 1991.&lt;/p&gt;', 'Where to Buy Cheap Nike SB Dunk High Strawberry Cough', '1634800625', 3, 'upload/photos/2021/10/CxF5nUp8AeC56LkxeLtT_21_8a39d987cd4184cdb7bb2ecf28431735_image.jpg', 120, 0, 'Where to Buy Cheap Nike SB Dunk High Strawberry Cough', '1'),
(11, 39485, 'The Supreme x Nike SB Dunk High By Any Means In Navy Red', '&lt;p&gt;Supreme and&lt;a href=&quot;https://www.sneakerheads2020.com&quot;&gt;&lt;strong&gt;Sneakerheads2020&lt;/strong&gt;&lt;/a&gt;returned to Dunk High in their latest collaboration, dressing it up as a symbol of the attitude of the streetwear brand. As we get closer and closer to the upcoming space capsule, more and more official pictures have surfaced. Here, we take a look at the navy and red color scheme, which was leaked a few months ago. Except for the swap on the palette, this pair also has all the same functions as the other pairs. The embroidery on the front foot and counter is reminiscent of New York souvenirs, spelling &quot;No&quot; and &quot;By Any Means&quot; respectively. In addition, the red heart and Nike&#039;s New York theme logo are dotted aside, adding more style to the aforementioned two-color background mainly composed of blue and red. More importantly, the Supreme logo wears the entire collar, insole, and removable tag.&lt;/p&gt;&lt;p&gt;After starting cooperation last year,&lt;a href=&quot;https://www.2021sneakers.com&quot;&gt;&lt;strong&gt;2021Sneakers&lt;/strong&gt;&lt;/a&gt;and Liverpool Football Club are about to launch their first batch of shoes. This may be part of a larger series, the recently revealed Air Huarache not only put the spotlight on the team&#039;s colors, but also their iconic national anthem. In order to cater to more lifestyles, Wallach is very different from jerseys. White is more important, applied to leather covers, nylon toes and midsoles. More importantly, it is the basis of adjacent checkered patterns, the red tiles of these patterns are more prominent due to the gloss. Then, the yellow parted from the middle, fully expressing respect for Liverpool&#039;s color. Finally, this heel is also customized with Velcro (velcro) padding, which can be affixed with the Nike brand or the abbreviation of the iconic slogan &quot;You&#039;ll never walk alone&quot; (You&#039;ll never walk alone).&lt;/p&gt;&lt;p&gt;The Adidas YEEZY BOOST 350 V2 &quot;MX Oat&quot; originally released in mid-June will finally be released tomorrow (October 23). Although the core color of this pair of shoes is not new to Ye&#039;s&lt;a href=&quot;https://www.2021yeezyboost.com&quot;&gt;&lt;strong&gt;2021 Yeezy Boost&lt;/strong&gt;&lt;/a&gt;shoe empire, the marble pattern on the Primeknit upper is. It can be seen from other rumors that the shape of &quot;MX&quot; (which may stand for &quot;MIX(ed)&quot;) will not disappear in the short term. The combination of navy blue, orange and dark gold makes the original bright cream layout full of vitality, and the pattern seems to have no &quot;rhythm or reason&quot;. The translucent mesh stripes on the side interrupt the colorful style and occupy most of the YEEZY upper. Under the soles of the feet, the ribbed midsole maintains its translucent makeup, revealing the BOOST cushioning its house.&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://www.nikeshoesformen.co.uk&quot;&gt;&lt;strong&gt;Nike Shoes for Men&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://www.skechers--shoes.com&quot;&gt;&lt;strong&gt;Skechers Shoes&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://www.heydudewomensshoes.com&quot;&gt;&lt;strong&gt;Hey Dude Women&#039;s Shoes&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://www.eccoshoessalecheap.com&quot;&gt;&lt;strong&gt;Ecco Shoes&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://www.skecherswomensoutlet.com&quot;&gt;&lt;strong&gt;Skechers Womens Outlet&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://www.heydudeshoesforgirls.com&quot;&gt;&lt;strong&gt;Hey Dude Shoes&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://www.drmarten-boots.com&quot;&gt;&lt;strong&gt;Dr Marten Boots&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://www.eccowomens-shoes.com&quot;&gt;&lt;strong&gt;Ecco Women&#039;s Shoes&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://www.heydudeshoes.us&quot;&gt;&lt;strong&gt;Hey Dude Shoes&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://www.dr-martensboots.us&quot;&gt;&lt;strong&gt;Dr Martens Boots&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://www.hobbylobbyhey.us&quot;&gt;&lt;strong&gt;Hobbylobbyhey&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://www.dr-martensboots.co.uk&quot;&gt;&lt;strong&gt;Dr Martens Boots&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://www.nikeairforce1shadow.us&quot;&gt;&lt;strong&gt;Nike Air Force 1 Shadow&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://www.catfootwears.us/&quot;&gt;&lt;strong&gt;Cat Footwears&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt; &lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://www.nike-sneakers.us&quot;&gt;&lt;strong&gt;Nike Sneakers&lt;/strong&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://www.favusnews.com&quot;&gt;&lt;strong&gt;Favusnews&lt;/strong&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://www.hotnewsinhk.com&quot;&gt;&lt;strong&gt;Hotnewsinhk&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt;&lt;/strong&gt;&lt;/p&gt;', 'The Supreme x Nike SB Dunk High By Any Means In Navy Red', '1634991733', 6, 'upload/photos/2021/10/hjshrXyNYUwjA4kiv6iB_23_82a17ad443c382c52d7d29454dd2036e_image.jpg', 157, 0, 'The Supreme x Nike SB Dunk High By Any Means In Navy Red', '1'),
(12, 39485, 'Travis Scott x Nike Air Max 1 Colorway to Release this Week', '&lt;p&gt;After collaborating with Hiroshi Fujiwara and his fragment design label for the two Air Jordan 1, Travis Scott is preparing to expand his highly sought-after footwear catalog, now with &lt;a href=&quot;https://www.2021sneakers.com&quot;&gt;&lt;strong&gt;2021Sneakers&lt;/strong&gt;&lt;/a&gt; The family is linked together. The next La Flame and Swoosh are the complete series of Air Max 1, and the latest color scheme has just surfaced. This latest makeup look is very similar to the interpretation of &quot;Baroque Brown&quot;, but it has been slightly adjusted in the upper part to make it independent. The mesh padding and the reverse canvas swooshish are all dialed into a natural white hue and are covered around the toe box, the middle foot and high heels are wrapped in the appropriate &quot;wheat&quot; hue for autumn. From here on, the popular red color stands out from the hiking-style shoelaces. Checked straps appear on the shoe body and heel, as well as the flag-shaped decoration on the heel. The shoe on the left has the Nike brand and the shoe on the right. There is Cactus Jack on it.&lt;/p&gt;&lt;p&gt;&lt;br /&gt;After the first collaboration earlier this year, &lt;a href=&quot;https://www.newdropjordans.com&quot;&gt;&lt;strong&gt;New Drop Jordans&lt;/strong&gt;&lt;/a&gt; and Vans once again joined forces to launch a second series. The new release focuses on the Sk8-Hi silhouette, and sees the brand mascot Jeremys duck as a different graphic approach. This classic skate is available in three colors, each with a mushroom print. On the &quot;black/blue&quot;, &quot;cotton candy&quot; and &quot;yellow&quot; uppers, the Palace name is spelled out with fungus-inspired patterns, and each heel is also decorated with an embroidered mushroom logo. Each color scheme has a checkerboard label hung on the jazz stripe, and a tongue sticker for the joint brand of Palace and Vans. Check out the gallery above and the latest Vans collaboration from Palace in the promotional video. All three Sk8-Hi color schemes will be released online on November 5th, and will be released in physical stores in London, New York and Los Angeles, in Tokyo, and through WeChat a day later.&lt;/p&gt;&lt;p&gt;&lt;br /&gt;Performance footwear and clothing brand HOKA has collaborated with Moncler to redesign the Mafate Speed 2 running shoes. &lt;a href=&quot;https://www.heydudeshoesforgirls.com&quot;&gt;&lt;strong&gt;Hey Dude Shoes&lt;/strong&gt;&lt;/a&gt; ,The redesigned contour is suitable for constructions prepared for mountainous and all-terrain performance. The shoes are characterized by a white and silver design with the iconic geometry of HOKA and the names of Moncler and HOKA. This shoe focuses on technical terrain, with a thick midsole support and Vibram Megagrip outsole to increase traction. This shoe uses Mon-Cola&#039;s tri-color details and its iconic Mon-Cola tongue patch. Last month, Moncler launched its first perfumes &quot;Moncler Pour Homme&quot; and &quot;Moncler Pour Femme&quot; through its &quot;Moncler Genius&quot; project. Men&#039;s fragrances are characterized by cedar, sandalwood, sage, vetiver and citrus, while women&#039;s fragrances are characterized by Italian bergamot, jasmine samba, heliotrope, amber, vanilla, etc. The limited edition Moncler x HOKA Mafate Speed 2 priced at 215 (approximately US$294) is now available in Moncler House of Genius stores, pop-up windows and some Moncler boutiques around the world. In addition, it will be available on HOKA.com from December 1, 2021.&lt;/p&gt;', 'Travis Scott x Nike Air Max 1 Colorway to Release this Week', '1635942188', 5, 'upload/photos/2021/11/I8MxqSog9KO6xszuMGBp_03_621ea282cadad3a0adb4e33ba8931edf_image.jpg', 127, 0, 'Travis Scott x Nike Air Max 1 Colorway to Release this Week', '1'),
(13, 39500, 'Stylish Todd Bratrud x Nike SB Dunk High Strawberry Cough Red', '&lt;p&gt;Have you been following the latest footwear news on the exclusive supplier website? If you missed it, the famous Japanese designer Jun Takahashi has collaborated with Chitose Abe and Swoosh brands to create a new look for their coveted sacai LDWaffle cut . &lt;a href=&quot;https://www.sneakerheads2020.com&quot;&gt;&lt;strong&gt;Sneakerheads2020&lt;/strong&gt;&lt;/a&gt; take a closer look at the new UNDERCOVER x sacai x Nike LDWaffle Bright Citron, which is undoubtedly one of the best products we have seen in a while. The official pictures of these three-brand shoes show colors including gray, black, sail and yellow. These tones are decorated with mixed leather, suede and nylon uppers, and even surround Abe&#039;s signature double patterns, such as tongue, sidewall Swooshes, laces, toes, and soles. For those who have missed other sacai x Nike products, we recommend you to click the notification ring above, because these are the must-have items for Nike sneaker collectors.&lt;/p&gt;&lt;p&gt;Todd Bratrud x Nike SB Dunk High Strawberry Cough Red sneakers are the latest &lt;a href=&quot;https://www.2021sneakers.com&quot;&gt;&lt;strong&gt;2021Sneakers&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt; &lt;/strong&gt; launched by this Oregon brand in collaboration with the famous illustrator Todd Bratrud. The duo had previously tamed some of the most hyped Dunk all the time the release, and the silhouette reached its peak again, this is just a meaningful new rendition launch. This high-top shoe looks to be a mix of furry suede and tumbling leather, and the design concept is around strawberries. The clean red and green exterior is the logo of Nike SB at the beginning of the 21st century and will definitely be sought after by fans of the brand. The strawberry pattern is located on the back heel, and the insole is also printed with a crazy graphic! Under the sole of the foot, the translucent rubber midsole is also reminiscent of past SB releases and hides high-end cushioning, making these worth adding to Nike&#039;s skateboard center String.&lt;/p&gt;&lt;p&gt;Over the years, Beaverton-based sportswear giant Nike has established a strong presence in the streetwear sector through high-temperature cooperation. &lt;a href=&quot;https://www.eccowomens-shoes.com&quot;&gt;&lt;strong&gt;Ecco Women&#039;s Shoes&lt;/strong&gt;&lt;/a&gt; ,In addition to Virgil Abloh and Travis Scott, Japanese designer Chitose Abe also won the hearts of many people because of her sacai x Nike LDWaffle design. And now, this silhouette has appeared in a new color form, this time with Takahashi&#039;s brand. UNDERCOVER x sacai x Nike LDWaffle Purple Blue is one of the three options in the package. There is no doubt that this pair of shoes must be a must-have for sneaker collectors, so be sure to see why this pair of shoes is so special. The mixed materials the couple saw were suede, smooth leather and nylon. All of these make up the purple, blue, gray and black tones of the entire panel, including sacai&#039;s iconic double Swoosh logo, tongue, toe, laces, and full-length midsole under the sole. The shoes sit on Nike&#039;s famous waffle outsole, providing traction for all terrains.&lt;/p&gt;', 'Stylish Todd Bratrud x Nike SB Dunk High Strawberry Cough Red', '1636337408', 5, 'upload/photos/2021/11/fKGyGfeLuMKYiLeA93rW_08_c36137a572865bed84b02b6b1cc95f51_image.jpg', 126, 0, 'Stylish Todd Bratrud x Nike SB Dunk High Strawberry Cough Red', '1'),
(14, 39500, 'Special Offer DH0775-200 Nike Air Force 1 07 LXX Toasty Rattan', '&lt;p&gt;Joining Nikes &quot;Lucky Charms&quot; series is Nike Air Force 1 Low LX Lucky Charms. This all-white Air Force 1 has a charming element hanging from the side collar. &lt;a href=&quot;https://www.cadysneaker.com&quot;&gt;&lt;strong&gt;Cadysneaker&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt; ,&lt;/strong&gt;The upper is white smooth leather from toe to heel, including contoured Swooshes. White is repeated on the tongue, laces, mesh sock lining, and even the air brand rubber midsole and outsole. All of this makes these golden ornaments that hang down from the top of the eyes and extend to the heels of the feet stand out. The Nike Air Metallic Gold brand on the tongue perfectly matches the charm. Who wouldnt like Nikes Air Force 1 07 Light Bone? The upgraded version of this classic basketball shoe seamlessly blends crunchy frosted leather and Nike air cushions, making it a light and comfortable walk to work, cafes, basically, Anywhere. &quot;Air Force One&quot; may be originally designed for basketball courts, but the modern low-waist silhouette, sleek bone color and streamlined design take these sneakers to a new level, ensuring that all your off-court suits are completed.&lt;/p&gt;&lt;p&gt;The Nike AF1 skull series has become the Halloween tradition of the Swoosh brand. &lt;a href=&quot;https://www.newdropjordans.com&quot;&gt;&lt;strong&gt;New Drop Jordans&lt;/strong&gt;&lt;/a&gt; With the previously released white, black and orange colors, this latest performance is in a striking purple variant. The Nike Air Force 1 &quot;Purple Skeleton&quot; comes in a full smooth and perforated leather upper to show the skeletal foot on its sides and inside. The same purple on the lining of the socks. Like the previous Nike Air Force One Skeleton, this pair of shoes has an outsole that glows in the dark. There are also x-ray foot pictures on the purple insoles. The Nike Air Force 1 logo is featured by the tongue tag and the Nike Air logo sitting on the heel in embroidered white. If you want to add a pair of scary sneakers to your &quot;trick or treat&quot; outfit, look no further. The Air Force No. 1 purple skull will be released in October this year and is a must-have for sneaker fans in the Halloween season.&lt;/p&gt;&lt;p&gt;Nike&#039;s toast series have been launched in these cold months. &lt;a href=&quot;https://www.heydudeshoes.us&quot;&gt;&lt;strong&gt;Hey Dude Shoes&lt;/strong&gt;&lt;/a&gt;,The latest product in this series is the Nike Air Force 1 07 LXX Roasted Rattan. It not only ensures that your feet stay warm and comfortable in autumn and winter, but is also part of Nike&#039;s &quot;zero sports&quot; activities. The foundation of this earth-toned Air Force 1 is a light beige rattan quilted material from the toe box and the lower part of the middle panel. The toe cap, part of the eye stay panel on the forefoot and the collar are the same quilted material, but in a chocolate brown. The foot and heel panel in the eye stop panel are bright orange. The swooshish on the inside and sides are wool black, matching the windmill logo on the eye rest panel, tongue lining and tongue label near the collar. The bright red Toasty patch is also in the Volt color insole.&lt;/p&gt;', 'Special Offer DH0775-200 Nike Air Force 1 07 LXX Toasty Rattan', '1636337675', 4, 'upload/photos/2021/11/zkASbzr3l9dpyFcJ7ATc_08_c30e05c22f5a9d0b94e0b64c91baccd6_image.jpg', 118, 0, 'Special Offer DH0775-200 Nike Air Force 1 07 LXX Toasty Rattan', '1'),
(15, 39500, 'The DA9054-001 Air Jordan 36 Infrared 23 Releasing Soon', '&lt;p&gt;With the release of &quot;mental energy&quot;, the Air Jordan 36 has cooled down and &lt;a href=&quot;https://www.cadysneaker.com&quot;&gt;&lt;strong&gt;Cadysneaker&lt;/strong&gt;&lt;/a&gt; has been placed on the side of the road for more than a few weeks. But it seems that the latest heir to the throne will finally make a comeback with its new &quot;Infrared 23&quot; color scheme. As its name implies, the couple pays homage to the Air Jordan 6 of the same name, not only reflecting its color palette, but its color blocks are as close as possible. The nominal &quot;infrared&quot; is applied to the decal of the mold, sandwiched between the cold bottom and the dark midsole. Above, the neutrality of the latter is the extensive use of grids, leather paneling, lace units, etc. It is only interrupted by various icon clicks and pull tabs, both of which have the red characteristics mentioned above. A few years ago, the idea of Rick Owens and Converse working together was simply unimaginable. This is due in large part to the designer&#039;s beloved Ramones silhouette, which is often compared to Chuck Taylor. Prior to this, his dunk-decorated with a swooshlike shape on the side-only got a stop order signed by Nike himself.&lt;/p&gt;&lt;p&gt;Originally released in 2000, Nike Air Kukini is a fanatical classic, and its disruptive design can even compete with Air Tuning Max. &lt;a href=&quot;https://www.heydudewomensshoes.com&quot;&gt;&lt;strong&gt;Hey Dude Women&#039;s Shoes&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt; ,&lt;/strong&gt;Although it was first retro in 2012, the outline quickly disappeared until Stussy&#039;s interpretation of the outline in 2020. This cooperation allows many people to see the hope of its return, and its return is finally in the near future. This Air Kukini will soon be available in two new colors. The first is a simple, neutral-led undertaking, building what looks like dark green and black fixtures. At the same time, this shoe will also use militaristic colors, mixing light olive and dark olive. A touch of orange, then, highlight the outsole and TPU cage, on the surface is a tribute to the beloved MA-1 jacket. Fast forward to November 2021, and Rick Owens has several collaborations worth watching. Soon, we will see his second interpretation of Chuck 70, which is aesthetically close to the aforementioned Ramones. If you are familiar with its predecessor, then this latest capsule should only bring some surprises. In terms of design, these two shoes are similar to the previous one, offering canvas uppers, slender tongues, thick soles, etc., both high-top and low-top.&lt;/p&gt;&lt;p&gt;After the tragedy of the Astro World Festival in 2021, Travis Scott&#039;s relationship will definitely be reassessed, but more photos of the Houstonian&#039;s upcoming collaboration continue to appear. The latest?: The first time I saw the Air Jordan 1 low OG &quot;reverse Mocha&quot;, it is expected to decline in 2022. In July 2019, Scott launched retro sneakers with &lt;a href=&quot;https://www.cat-boots.us&quot;&gt;&lt;strong&gt;Cat Boots&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt; ,&lt;/strong&gt;brown as the mainstay. This is an interesting change. The upcoming sneakers choose the arrangement of heavy white and off-white. The toe box, the middle foot plate, the tongue and the collar, however, are immersed in the tone of the previous Air Jordan 1 Low&#039;s title &quot;Dark Mocha&quot;. La Flame&#039;s iconic backspin pattern on the side reappeared, while &quot;University Red&quot; was animated on the tip of the tongue and heel. At the foot, Scott&#039;s next Air Jordan 1 low-top shoe has been worn on his daughter. The midsole of this shoe is Sail, which looks &quot;old&quot;, and the outsole is dark brown. The combination. However, their color scheme has changed: the low-match is now a more classic black and white match, while the high-contrast one is almost completely white. In addition, the hat toe abandoned the square mold and chose a rounder, disproportionate shape.&lt;/p&gt;', 'The DA9054-001 Air Jordan 36 Infrared 23 Releasing Soon', '1636548230', 4, 'upload/photos/2021/11/OAoQ1SYVwUG59JP2ZxTD_10_2dee0e0830b3a5014c8d775cbcceb855_image.jpg', 116, 0, 'The DA9054-001 Air Jordan 36 Infrared 23 Releasing Soon', '1');
