(137, 'connectivity_system_note', '', '<span style=\"color:red;\">Note:</span> If you change the system to one another, all existing followings, followers, friends will be deleted.</small>', '<span style=\"color:red;\">:</span>       ,       ,   !</small>', '<span style=\"color:red;\">Note:</span> If you migrate from one system to another, all existing followings, followers, friends, memberships will be deleted to avoid issues.</small>', '<span style=\"color:red;\">Note:</span> Si vous changez de systme, tous les abonns, abonnements et amis existants seront supprims.</small>', '<span style=\"color:red;\">Achtung:</span> Wenn Du von einem System zu einem anderen migrierst, werden alle existierenden: Folger, Verfolger, Freunde, Mitgliedschaften gelscht um Probleme zu vermeiden.</small>', '<span style=\"color:red;\">Nota:</span> Se si esegue la migrazione da un sistema all\'altro, tutti i seguenti esistenti, seguaci, amici, appartenenze verranno eliminati per evitare problemi.</small>', '<span style=\"color:red;\">Observa&ccedil;&atilde;o:</span> Se voc&ecirc; mudar o sistema, todos aqueles que voc&ecirc; segue, que te seguem e seus amigos ser&ccedil;o perdidos.</small>', '<span style=\"color:red;\">:</span>        ,   , , ,   ,   .</small>', '<span style=\"color:red;\">Nota:</span> Si migras de un sistema a otro, Toda la informacion existente, seguidos, seguidores, etc.., sera eliminada para evitar conflictos.</small>', '<span style=\"color:red;\">Not:</span> Eer bir sistemden dierine g, tm mevcut followings, takipileri, arkadalar, yelikleri sorunlar nlemek iin silinir.</small>', '<span style=\"color:red;\">Note:</span> Si ou chanje sistm nan youn ak lt, tout swivi ki deja egziste ak zanmi yo ap efase.</small>'),
