(1288, 'good_afternoon_quote', '', 'May this afternoon be light, blessed, enlightened, productive and happy.', '         .', 'Moge vanmiddag licht, gezegend, verlicht, productief en gelukkig zijn.', 'Puisse cet aprs-midi tre lger, bni, clair, productif et heureux.', 'Mge heute Nachmittag hell, gesegnet, erleuchtet, produktiv und glcklich sein.', 'Possa questo pomeriggio essere leggero, benedetto, illuminato, produttivo e felice.', 'Que esta tarde seja leve, abenoada, iluminada, produtiva e feliz.', '   , , ,   .', 'Que esta tarde sea luz, bendita, iluminada, productiva y feliz.', 'Bu leden sonra hafif, kutsanm, aydnlanm, retken ve mutlu olabilir.', 'May this afternoon be light, blessed, enlightened, productive and happy.'),
(1289, 'good_evening_quote', '', 'Evenings are lifes way of saying that you are closer to your dreams.', '        .', 'Avonden zijn de manier om te zeggen dat je dichter bij je dromen bent.', 'Les soires sont la manire de la vie de dire que vous tes plus proche de vos rves.', 'Abende sind die Lebensart zu sagen, dass Sie Ihren Trumen nher sind.', 'Le sere sono il modo in cui la vita ti dice che sei pi vicino ai tuoi sogni.', 'As noites so a maneira da vida de dizer que voc est mais perto de seus sonhos.', ' -    ,      .', 'Las noches son la forma en que la vida dice que ests ms cerca de tus sueos.', 'Akamlar yaamn, hayallerinize daha yakn olduunuzu syleme biimidir.', 'Evenings are lifes way of saying that you are closer to your dreams.'),
