ION &amp; SUSPENSION</strong>. 8</a></p>\n<p><a href=\"#_Toc79984976\"><strong>21) NO WARRANTIES</strong>. 8</a></p>\n<p><a href=\"#_Toc79984977\"><strong>22) LIMITATION ON LIABILITY</strong>. 8</a></p>\n<p><a href=\"#_Toc79984978\"><strong>23) DISCLAIMER</strong>. 9</a></p>\n<p><a href=\"#_Toc79984979\"><strong>24) GENERAL PROVISIONS:</strong> 10</a></p>\n<p></p>\n<p>Welcome to Vwanus Terms and conditions. Please read this carefully before using our website/Platform, or services. This is a contract between you and <a href=\"../\"><strong>Vwanu</strong></a>. We\'ve also included several annotations that aren\'t a part of the contract itself but are intended to emphasize key sections and help you follow the text. We\'ve tried to be fair and straightforward. Please feel free to contact us if you have any questions or suggestions!</p>\n<p><a name=\"_Toc79984953\"></a>THE AGREEMENT: The use of this Website and services on this Platform are provided by Vwanu(hereinafter referred to as \"Platform\") is subject to the following Terms &amp; Conditions, all parts, and sub-parts of which are specifically incorporated by reference here. This agreement shall govern the use of all pages on this App (hereinafter collectively referred to as \"Platform\") and any services provided by or on this Platform (\"Services\").</p>\n<h2><a name=\"_Toc79984954\"></a><strong>1) DEFINITIONS</strong></h2>\n<p>Agreement denotes to this Terms and Conditions and the Privacy Policy and other documents provided to you by the Platform;</p>\n<p>We, us, and our are references to <a href=\"../\"><strong>Vwanu</strong></a>;</p>\n<p>User, You, and your denotes the person who is accessing the Platform for taking or availing any service from us. User shall include the company, partnership, sole trader, person, body corporate or association taking services of this Platform;</p>\n<p> Platform shall mean and include <a href=\"../\"><strong>Vwanu</strong></a> and any successor Platform of the Company or any of its affiliates;</p>\n<p>Parties: Collectively, the parties to this Agreement (We and You) will be referred to as Parties.</p>\n<h2><a name=\"_Toc79984955\"></a><strong>2) ASSENT &amp; ACCEPTANCE</strong></h2>\n<p>By using the Platform, you warrant that you have read and reviewed this agreement and that you agree to be bound by it. If you do not agree to be bound by this agreement, please leave the Platform immediately. We only agree to provide the users of this Platform and Services to you if you assent to this agreement.</p>\n<h2><a name=\"_Toc79984956\"></a><strong>3) SERVICE</strong></h2>\n<p>The Services and the Platform are only for people 13 years old and over.</p>\n<p>We will provide further information regarding how Vwanu uses and accesses your device within Vwanu or in another manner (e.g., via the relevant Platform store as part of the installation process for Vwanu on your device). You agree to give us such access to and use of your device, and you acknowledge that if you do not provide us with such right of use or access, we may not be able to provide Vwanu (or certain features within Vwanu) to you.</p>\n<p>We agree to provide you with the <a href=\"../\"><strong>Vwanu</strong></a> Service. The Service includes all of the Vwanu products, features, applications, services, technologies, and software that we provide to advance Vwanu \'s mission: To carry and bring you nearer to individuals and things you love in your life. The Service is made up of the following aspects</p>\n<ul>\n<li><strong>Offering customized freedoms to make, associate, impart, find, and offer.</strong></li>\n</ul>\n<p>People are different. We want to strengthen your relationships through shared experiences you care about. So, we build systems that try to understand who and what you and others care about and use that information to help you create, find, join, and share experiences that matter to you. Part of that is highlighting Content, features, offers, and accounts you might be interested in and offering ways for you to experience Vwanu, based on things you and others do on and off Vwanu.</p>\n<ul>\n<li>The Services allow you to create, publish and share short-form videos and to consume videos other users have created and interact with those videos and other users.</li>\n<li>Create and share videos: In particular:</li>\n<li>You can record or import videos into the Services.</li>\n<li>You can edit videos and enrich them with filters and additional elements.</li>\n<li>You can also include Content from other users in your videos, provided the creator of the respective video allows the use of their Content for such purposes. Other users can use your Content in their videos if you will enable the use of your Content for such purposes.</li>\n<li>You can publish videos in the Services so that other users can consume your videos. Videos you post publicly will be available in the Platform.</li>\n<li><strong>Offering customized freedoms to make, associate, impart, find, and offer.</strong></li>\n</ul>\n<p>We create and use tools and offer assets to our local area individuals that help to make their encounters positive and comprehensive, including when we figure they may require help. We likewise have groups and frameworks that work to battle misuse and infringement of our Terms and approaches, just as hurtful and beguiling conduct. We utilize all the data we have-including your data to attempt to keep our foundation secure. We likewise may share data about abuse or unsafe substance with other law authorization.</p>\n<ul>\n<li>You can use the Services and the Platform via the Vwanu Platforms (Platform) and the Vwanu Platform (Platform). Certain functions are available only in the Platform. Further, not all Services or features may be available in your country or region. Different features may be available in different versions of the Services. Certain features are not available for users under a certain age.</li>\n<li><strong>Creating and utilizing innovations that assist us with serving our developing local area.</strong></li>\n</ul>\n<p>Organizing and analyzing information for our growing community is central to our Service. A big part of our Service is creating and using cutting-edge technologies that help us personalize, protect, and improve our Service on an incredibly large scale for a broad global community. Technologies like artificial intelligence and machine learning give us the power to apply complex processes across our Service. Automated technologies also help us ensure the functionality and integrity of our Service.</p>\n<ul>\n<li>You can share your videos, or videos of others that have enabled sharing, via various messaging services and on third-party social media platforms (e.g. Instagram, Facebook, YouTube, Twitter) by the respective terms of Service.</li>\n<li>You can enter a video description, tags, and various privacy settings when publishing a video.</li>\n<li>You can enter a short biography text and profile picture in your public user profile.</li>\n<li><strong>Giving predictable and consistent encounters across the platform</strong></li>\n</ul>\n<p>Vwanu, which shares technology, systems, insights, and information-including the information we have about you to provide services that are better, safer, and more secure. We also offer ways to interact across the Facebook Company Products that you use, and designed systems to achieve a seamless and consistent experience across the Vwanu Platform.</p>\n<ul>\n<li>You can consume videos that other users have shared publicly or by users you follow.</li>\n<li>The Service provides you with a customized For You page in which the Service selects videos to show you based on what the Service determines could be interesting for you. For further information, please see the Privacy Policy.</li>\n<li>The Service provides other ways to find Content for you to consume, e.g. a list of other users videos on their profile, a search function, and category selection.</li>\n<li>You can watch live streams of other users.</li>\n<li>Interact with other users: You can interact with users Content and other users. In particular:</li>\n<li>Direct messages: You can send direct messages to users if they follow you.</li>\n<li>Likes: You can like videos.</li>\n<li>Comments: Subject to users settings, you can post comments on their videos.</li>\n<li>Follows: You can track users. If users restrict their profile, you can only follow users if they approve your request to follow.</li>\n<li><strong>Ensuring access to our Service.</strong></li>\n</ul>\n<p>To operate our global Service, we must store and transfer data across our systems around the world, including outside of your country of residence. The use of this global infrastructure is essential to provide our Service.</p>\n<ul>\n<li><strong>Research and innovation.</strong></li>\n</ul>\n<p>We use the information we have to develop, test, and improve our Service and collaborate with others on research to make our Service better and contribute to the well-being of our community. This includes analyzing the data we have about our users and understanding how people use our Services, for example by conducting surveys and testing and troubleshooting new features.</p>\n<h2><a name=\"_Toc79984957\"></a><strong>4) GENERAL CONDITION</strong></h2>\n<ul>\n<li>We do not guarantee the accuracy, completeness, validity, or timeliness of information listed by us or other users.</li>\n<li>We make material changes to these terms and conditions from time to time, we may notify you either by prominently posting a notice of such changes or via email communication.</li>\n<li>The Platform is licensed to you on a limited, non-exclusive, non-transferable, non-sublicensable basis, solely to be used in connection with the Service for your private, personal, non-commercial use, subject to all the terms and conditions of this agreement as they apply to the Service.</li>\n</ul>\n<h2><a name=\"_Toc79984958\"></a><strong>5)