e, regulation, or ordinance;</li>\n<li>uses or attempts to use another\'s account, password, Service, or system except as expressly permitted by the Terms of use uploads or transmits viruses or other harmful, disruptive, or destructive files;</li>\n<li>sends repeated messages related to another user and/or makes derogatory or offensive comments about another individual or repeats prior posting of the same message under multiple emails or subjects.</li>\n<li>Any submitted content that includes, but is not limited to the following, will be refused. If repeated violations occur, we reserve the right to cancel user access to the Platform without advanced notice.</li>\n</ul>\n<ul>\n<li>You Give to Us. As part of our agreement, you also give us the permissions that we need to provide the Service.</li>\n<li>We do not claim ownership of your Permissions content, but you grant us a license to use it.</li>\n<li>Nothing is changing about your rights in your Content. We do not claim ownership of the Content that you post on or through the Service and you are free to share your Content with anyone else, wherever you want. However, we need specific legal permissions from you (known as a license) to provide the Service. When you share, post, or upload Content that is covered by intellectual property rights (like photos or videos) on or in connection with our Service, you hereby grant to us a non-exclusive, royalty-free, transferable, sub-licensable, worldwide license to host, use, distribute, modify, run, copy, publicly perform or display, translate, and create derivative works of your Content (consistent with your privacy and application settings). This license will end when your Content is deleted from our systems. You can delete Content individually or all at once by deleting your account.</li>\n</ul>\n<h2><a name=\"_Toc79984961\"></a><strong>7) INTELLECTUAL PROPERTY</strong></h2>\n<p>You agree that the Platform and all Services provided by us are the property of Vwanu, including all copyrights, trademarks, trade secrets, patents, and other intellectual property (\"Our IP\"). You agree that we own all rights, title, and interest in and to the Our IP and that you will not use Our IP for any unlawful or infringing purpose. You agree not to reproduce or distribute Our IP in any way, including electronically or via registration of any new trademarks, trade names, service marks, or Uniform Resource Locators (URLs), without express written permission from us.</p>\n<ul>\n<li>To make the Platform and Services available to you, you hereby grant us a royalty-free, non-exclusive, worldwide license to copy, display, use, broadcast, transmit and make derivative works of any content you publish, upload, or otherwise make available to the Platform (\"Your Content\"). We claim no further proprietary rights in your Content.</li>\n<li>If you feel that any of your intellectual property rights have been infringed or otherwise violated by the posting of information or media by another of our users, please contact us and let us know.</li>\n</ul>\n<h2><a name=\"_Toc79984962\"></a><strong>8) USER OBLIGATIONS</strong></h2>\n<p>Only you have the right to access and use your account. You are responsible for ensuring that your login information remains confidential at all times. Vwanu will assume that if your login is used to access the Services, the user has the legal authority to use such login. If you become aware of unauthorized use of your login, you agree to notify VWANU immediately by email at Vwanu. You remain liable for any activity on your account until VWANU has been notified and has had an opportunity to take appropriate action.</p>\n<ul>\n<li>You hereby acknowledge and understand that each User is solely responsible for all aspects of its own day-to-day operations, including the provision of products (by any method, including through delivery), Service, environment, and overall quality and accuracy.</li>\n</ul>\n<h3><a name=\"_Toc79984963\"></a><strong>Compliance.</strong></h3>\n<ul>\n<li>You hereby acknowledge and understand that each user is solely responsible for any marketing, selling, and provision of any products or services offered to Guests through the Services in compliance with all Applicable Law and Rules. VWANU makes no representation or warranty regarding whether a user holds any applicable permit, license, registration, or another credential for its business; whether terms by a user are true and accurate; or whether a user complies with Applicable Law and Rules, and <a href=\"../\"><strong>Vwanu</strong></a> is not responsible for the quality of the products or services provided by any user on the platform.</li>\n</ul>\n<h2><a name=\"_Toc79984964\"></a><strong>9)NO MALICIOUS OR ILLEGAL USE</strong></h2>\n<p><em>Account Owner and any Authorized User shall not (and shall not allow any third party to):</em></p>\n<ol>\n<li>distribute viruses or other harmful or malicious computer code via or into the Platform;</li>\n<li>engage in any conduct that disrupts or impedes a third partys use and enjoyment of the VWANU Services;</li>\n<li>use the output or other information generated by the Services for any purpose other than as contemplated by this agreement;</li>\n<li>use the VWANU Services for any use other than Customers internal business use;</li>\n<li>use unauthorized modified versions of the Services, including without limitation, to build a similar or competitive Platform or Services or to obtain unauthorized access to the Services;</li>\n<li>use the Services in any way that is contrary to applicable local, state/provincial, federal and foreign laws, including without limitation those relating to privacy, electronic communications and anti-spam legislation.</li>\n<li>VWANU retains all titles to, and, except as expressly licensed herein, all rights to the Services, all copies, derivatives and improvements thereof and all related documentation and materials.</li>\n</ol>\n<h2><a name=\"_Toc79984965\"></a><strong>10) ACCEPTABLE USE</strong></h2>\n<p>You agree not to use the Platform or Services for any unlawful purpose or any purpose prohibited under this clause. You agree not to use the Platform or Services in any way that could damage the Platform, Services, or general business of Vwanu.</p>\n<ul>\n<li>You further agree not to use the Platform or Services:</li>\n<li>To harass, abuse, or threaten others or otherwise violate any person\'s legal rights;</li>\n<li>To violate any of our intellectual property rights or any third party;</li>\n</ul>\n<ul>\n<li>To upload or otherwise disseminate any computer viruses or other software that may damage the property of another;</li>\n</ul>\n<ul>\n<li>To perpetrate any fraud;</li>\n<li>To engage in or create any unlawful gambling, sweepstakes, or pyramid scheme;</li>\n<li>To publish or distribute any obscene or defamatory material;</li>\n<li>To publish or distribute any material that incites violence, hate, or discrimination towards any group;</li>\n<li>To unlawfully gather information about others.</li>\n</ul>\n<h2><a name=\"_Toc79984966\"></a><strong>11) ASSUMPTION OF RISK</strong></h2>\n<p>The Platform and Services are provided for communication purposes only. You acknowledge and agree that any information posted on Our Platform is not intended to be legal advice, medical advice, or financial advice, and no fiduciary relationship has been created between you and us. You further agree that your purchase of any of the products on the Platform is at your own risk. We do not assume responsibility or liability for any advice or other information given on the Platform.</p>\n<h2><a name=\"_Toc79984967\"></a><strong>12) REVERSE ENGINEERING &amp; SECURITY</strong></h2>\n<p>You agree not to undertake any of the following actions:</p>\n<ol>\n<li>a) Reverse engineer, or attempt to reverse engineer or disassemble any code or software from or on the Platform or Services;</li>\n<li>b) Violate the security of the Platform or Services through any unauthorized access, circumvention of encryption or other security tools, data mining, or interference to any host, user, or network.</li>\n</ol>\n<h2><a name=\"_Toc79984968\"></a><strong>13) INDEMNIFICATION</strong></h2>\n<p>You agree to defend and indemnify us and any of our affiliates (if applicable) and hold us harmless against any legal claims and demands, including reasonable attorney\'s fees, which may arise from or relate to your use or misuse of the Platform or Services, your breach of this agreement, or your conduct or actions. You agree that we shall be able to select its legal counsel and may participate in its defense if we wish.</p>\n<h2><a name=\"_Toc79984969\"></a><strong>14) EXCLUSION OF LIABILITY</strong></h2>\n<p>You understand and agree that we (A) do not guarantee the accuracy, completeness, validity, or timeliness of information listed by us or any third parties; and (B) shall not be responsible for any materials posted by us or any third party. You shall use your judgment, caution, and common sense in evaluating any prospective methods or offers and any information provided by us or any third party.</p>\n<p>Further, we shall not be liable for direct, indirect consequential, or any other form of loss or damage that may be suffered by a user through the use of the Vwanu Platform including loss of data or information or any kind of financial or physical loss or damage.</p>\n<p>In no event shall Vwanu , nor its Owner, directors, employees, partners, agents, suppliers, or affiliates, be accountable for any indirect, incidental, special, eventful, or exemplary costs, including without limitation, loss of proceeds, figures, usage, goodwill, or other intangible losses, consequential from (i) your use or access of or failure to access or use the Service; (ii) any conduct or Content of any third party on the Service; (iii) any content attained from the Service; and (iv) unlawful access, use or alteration of your transmissions or Content, whether or not based on guarantee, agreement, domestic wrong (including carelessness) or any other lawful concept, whether or not we\'ve been aware of the possibility of such damage, and even if a cure set forth herein is originated to have futile of its important purpose.</p>\n<h2><a name=\"_Toc79984970\"></a><strong>15) SPAM POLICY</strong></h2>\n<p>You are strictly prohibited from using the Platform or any of our Services for illegal spam activities, including gathering email addresses and personal information from others or sending any mass commercial emails.</p>\n<h2><a name=\"_Toc79984971\"></a><strong>16) THIRD-PARTY LINKS &amp; CONTENT</strong></h2>\n<p>We may occasionally post links to third-party Apps or other services. You agree that we are not responsible for any loss or damage caused as a result of your use of any third-party services linked to or from Our Platform.</p>\n<h2><a name=\"_Toc79984972\"></a><strong>17) MODIFICATION &amp; VARIATION</strong></h2>\n<p>We may, from time to time and at any time without notice to you, modify this agreement. You agree that we have the right to modify this agreement or revise anything contained herein. You further agree that all modifications to this agreement are in full force and effect immediately upon posting on the Platform and that modifications or variations will replace any prior version of this agreement unless prior versions are specifically referred to or incorporated into the latest modification or variation of this agreement.</p>\n<h2><a name=\"_Toc79984973\"></a><strong>18) ENTIRE AGREEMENT</strong></h2>\n<p>This agreement constitutes the entire understanding between the Parties concerning any use of this Platform. This agreement supersedes and replaces all prior or contemporaneous agreements or understandings, written or oral, regarding the use of this Platform.</p>\n<h2><a name=\"_Toc79984974\"></a><strong>19) SERVICE INTERRUPTIONS</strong></h2>\n<p>We may need to interrupt your access to the Platform to perform maintenance or emergency services on a scheduled or unscheduled basis. You agree that your access to the App may be affected by unanticipated or unscheduled downtime, for any reason, but that we shall have no liability for any damage or loss caused as a result of such downtime.</p>\n<h2><a name=\"_Toc79984975\"></a><strong>20) TERM, TERMINATION &amp; SUSPENSION</strong></h2>\n<p>We may terminate this agreement with you at any time for any reason, with or without cause. We specifically reserve the right to terminate this agreement if you violate any of the terms outlined herein, including, but not limited to, violating the intellectual property rights of us or a third party, failing to comply with applicable laws or other legal obligations, and/or publishing or distributing illegal material. If you have registered for an account with Us, you may also terminate this agreement at any time by contacting us and requesting termination. At the termination of this agreement, any provisions that would be expected to survive termination by their nature shall remain in full force and effect.</p>\n<ul>\n<li>We can remove any content or information you share on the Service if we believe that it violates these Terms of Use, our policies</li>\n<li>Content will not be deleted within 90 days of the account deletion or content deletion process beginning in the following situations:</li>\n<li>Where your Content has been used by others by this license and they have not deleted it (in which case this license will continue to apply until that Content is deleted); or</li>\n<li>Where deletion within 90 days is not possible due to technical limitations of our systems, in which case, we will complete the deletion as soon as technically feasible; or</li>\n<li>Where deletion would restrict our ability to:</li>\n<li>Investigate or identify illegal activity or violations of our terms and policies (for example, to identify or investigate misuse of our products or systems);</li>\n<li>Protect the