(2, 'privacy_policy', '<h1><a name=\"_Toc79984729\"></a><a name=\"_Toc80400230\"></a><strong>Privacy Policy</strong></h1>\n<p>Contents</p>\n<p><a href=\"#_Toc80400230\"><strong>Privacy Policy</strong>. 1</a></p>\n<p><a href=\"#_Toc80400231\"><strong>What private data do we collect from the people who visit our Platform?</strong>. 1</a></p>\n<ul>\n<li><a href=\"#_Toc80400232\"> <strong>Account Data:</strong> 1</a></li>\n<li><a href=\"#_Toc80400233\"> <strong>Profile Data:</strong> 2</a></li>\n<li><a href=\"#_Toc80400234\"> <strong>Financial Data:</strong> 2</a></li>\n</ul>\n<p><a href=\"#_Toc80400235\">When do we acquire information?. 2</a></p>\n<p><a href=\"#_Toc80400236\">Automatically collected information about your use of our Services or tools, 2</a></p>\n<p><a href=\"#_Toc80400237\"><strong>How do we use your details?</strong>. 3</a></p>\n<p><a href=\"#_Toc80400238\"><strong>Who do we share your data with?</strong>. 4</a></p>\n<p><a href=\"#_Toc80400239\">How can I exercise my rights over my data?. 4</a></p>\n<p><a href=\"#_Toc80400240\"><strong>USA-SPECIFIC TERMS</strong>. 4</a></p>\n<p><a href=\"#_Toc80400241\"><strong>AUSTRALIA-SPECIFIC TERMS</strong>. 5</a></p>\n<p><a href=\"#_Toc80400242\"><strong>Customer Data Processing Appendix:</strong> 5</a></p>\n<p><a href=\"#_Toc80400243\">GDPR-Eu Data Protection Law.. 5</a></p>\n<p><a href=\"#_Toc80400244\"><strong>California Online Privacy Protection Act</strong> 6</a></p>\n<p><a href=\"#_Toc80400245\"><strong>According to CalOPPA, we agree to the following:</strong> 6</a></p>\n<p><a href=\"#_Toc80400246\"><strong>Your Brazilian Privacy Rights</strong> 7</a></p>\n<p><a href=\"#_Toc80400247\"><strong>How does our Platform handle Do Not Track signals?</strong>. 8</a></p>\n<p><a href=\"#_Toc80400248\"><strong>COPPA (Children Online Privacy Protection Action)</strong> 8</a></p>\n<p><a href=\"#_Toc80400249\"><strong>Fair Information Practices</strong>. 9</a></p>\n<p><a href=\"#_Toc80400250\"><strong>CAN-SPAM Act</stron