by us or any of our Service Providers (characterized underneath), if you don\'t mind just don\'t enter our Platform or utilize our Services.</li>\n<li>You may likewise decide not to give us \"discretionary\" Personal Data, however please remember that without it we will most likely be unable to give you the full scope of our administrations or with the best client experience when utilizing our Services.</li>\n<li><a href=\"../\"><strong>Vwanu</strong></a> Provides social media platform.</li>\n</ul>\n<h2><a name=\"_Toc79984730\"></a><a name=\"_Toc80400231\"></a><strong>What private data do we collect from the people who visit our Platform?</strong></h2>\n<p>When enlisting on our Platform, as suitable, you could be approached to type in your name, email, address information, or different subtleties to assist you with your experience.</p>\n<p>When you create an account and use the Services, including through a third-party platform, we collect any data you provide directly, including:</p>\n<ul>\n<li><a name=\"_Toc79984731\"></a><a name=\"_Toc80400232\"></a><strong>Account Data:</strong> To use certain features, you need to create a user account. When you create or update your account, we collect and store the Data you provide, like your email address, password, gender, and date of birth, and assign you a unique identifying number (\"Account Data\").</li>\n</ul>\n<ul>\n<li><strong>Location Data:</strong> is information that is derived from your GPS, Wi-Fi, compass, accelerometer, IP address, or public posts that contain location information. Location information will be disclosed (either to us, to other users, or both):\n<ul>\n<li>when you use location-based features, such as People Nearby, POI search, and when you share your location with other <a href=\"../\"><strong>Vwanu</strong></a> users; and</li>\n<li>when you access <a href=\"../\"><strong>Vwanu</strong></a>, we derive location information from your IP address, device, or internet service to prevent multiple or fraudulent log-ins to your account.</li>\n</ul>\n</li>\n</ul>\n<ul>\n<li><strong>Personal Data</strong>: Personal Data is information that can be used to identify you specifically, including your name, email, time zone, email address, or demographic information like your age, gender, or hometown. You consent to give us this information by providing it to us voluntarily on our mobile application. You provide some of this information when you register with or make purchases from our Platform. You may also give this information by participating in various activities associated with our Platform, including responding to blogs, contacting us with questions, or participating in group training. Your decision to disclose this Data is entirely voluntary. You are under no obligation to provide this information, but your refusal may prevent you from accessing certain benefits from our Platform.</li>\n<li><a name=\"_Toc79984732\"></a><a name=\"_Toc80400233\"></a><strong>Profile Data:</strong> You can also choose to provide profile information like a photo, headline, Platform link, social media profiles, or other data. Your Profile Data will be publicly viewable by others.</li>\n</ul>\n<ul>\n<li><a name=\"_Toc80400234\"></a> <strong>Financial Data:</strong> Financial data is related to your payment methods, such as credit card or bank transfer details. We collect financial data to allow you to purchase, order, return or exchange products or services from our website and any related mobile apps. We store limited financial data. Most financial data is transferred to our payment processor, Stripe, and you should review these processors\' Privacy Policy to determine how they use, disclose and protect your financial data.\n<ul>\n<li>Stripe Privacy Policy can be <a href=\"https://stripe.com/gb/privacy\">found here</a> https://stripe.com/gb/privacy</li>\n</ul>\n</li>\n</ul>\n<h2><a name=\"_Toc79984734\"></a><a name=\"_Toc80400235\"></a>When do we acquire information?</h2>\n<p>We get data from you when you get enlisted on our Platform, respond to an audit, give us reactions on our items or enter information on our Platform below are the examples:</p>\n<ul>\n<li>if you register to become a user of Our Services;</li>\n<li>if you send Us a message through Our Services or correspond with Us by telephone in writing or otherwise;</li>\n<li>as you visit our Platform;</li>\n<li>if you subscribe to one of Our Services;</li>\n<li>participate in a discussion board or other social media functions on Our Services;</li>\n<li>if you enter a competition, promotion, or survey;</li>\n<li>if you report a problem to us; and</li>\n<li>from any of your activities in connection with your use of Our Services.</li>\n<li>To register on our Platform to get updated about new posts.</li>\n<li>To deal with our relationship with you, including notifying you about changes to our terms or security arrangement. Request that you leave an auditor to take an overview.</li>\n<li>To manage and ensure our business and this Platform (counting investigating, information examination, testing, framework upkeep, backing, announcing, and facilitating information).</li>\n<li>To send you our email pamphlet and other robotized email correspondences.</li>\n<li>To make proposals and suggestions to you about merchandise or administrations that might hold any importance with you.</li>\n</ul>\n<h3><a name=\"_Toc79984735\"></a><a name=\"_Toc80400236\"></a>Automatically collected information about your use of our Services or tools,</h3>\n<p>This Information is registered automatically with the visit by own configuration or manual of each tool on the Platform</p>\n<ul>\n<li>When you visit, connect with, or utilize our service, we may gather, record or create specific specialized data about you. We do so either autonomously or with the assistance of third gathering Service Providers, including using \"<strong>cookies</strong>\" and other following innovations.</li>\n</ul>\n<p></p>\n<ul>\n<li>Such data comprises of availability, specialized and collected utilization data, for example, <strong>IP locations</strong> and <strong>general areas</strong>, <strong>gadget data</strong> (like sort, working framework, cell phone id, program form, region and language settings, Browser Information, Geographic location, Time of Visit, Referring Platform, applications or service, search engine utilized), date and time stamps of use, the and pixels introduced or used on such gadget and the recorded movement (meetings, clicks and further cooperation\'s) of Visitors and Users regarding our Service. for purposes including examination, service-, tasks, and business quality control and enhancements, and record-keeping purposes.</li>\n</ul>\n<p>This is to improve the Platform, services, and security, among which we include security inspection by the administration of the Platform and third parties.</p>\n<h2><a name=\"_Toc79984738\"></a><a name=\"_Toc80400237\"></a><strong>How do we use your details?</strong></h2>\n<p>We may utilize the Data we procure from you when you enlist, join our bulletin, respond to an examination or promoting correspondence, peruse the Platform, or use specific other Platform includes in the following ways:</p>\n<ul>\n<li>To set up and log in to a user account on <a href=\"../\"><strong>Vwanu</strong></a>;</li>\n<li>To notify you about changes to <a href=\"../\"><strong>Vwanu</strong></a>;</li>\n<li>To facilitate communication;</li>\n<li>to verify your identity account security.</li>\n<li>To provide you with user support;</li>\n<li>To enforce our terms, conditions, and policies;</li>\n<li>To place VOIP calls using <a href=\"../\"><strong>Vwanu</strong></a>;</li>\n<li>To communicate with you;</li>\n<li>To provide personalized help and instructions;</li>\n<li>To better understand how you access and use <a href=\"../\"><strong>Vwanu</strong></a>;</li>\n<li>To develop new and improve existing services;</li>\n<li>To provide language and location customization;</li>\n<li>To protect any rights, property, or safety of ours, our affiliate companies, or other users of <a href=\"../\"><strong>Vwanu</strong></a>; and</li>\n<li>To administer <a href=\"../\"><strong>Vwanu</strong></a> and internal operations, including troubleshooting, data analysis, testing, research, security, fraud-detection, account management, and survey purposes.</li>\n</ul>\n<ul>\n<li>Where we have to play out the Agreement, we are going to go into or have gone into with you</li>\n<li>To tweak your experience and permit us to give the kind of substance and item contributions you are generally intrigued by.</li>\n<li>To help our Platform that will be ready to serve you better.</li>\n<li>To allow us to brought administration you up in furnishing a response to your client assistance demands.</li>\n<li>To procure rankings and audits of items</li>\n<li>To send messages after a certain time routinely, for your administrations or items and different items.</li>\n<li>To catch up after correspondence with (live talk, email, or telephone requests)</li>\n<li>To furnish you with the data, items, and administrations that you demand from the Platform.</li>\n</ul>\n<h2><a name=\"_Toc79984739\"></a><a name=\"_Toc80400238\"></a><strong>Who do we share your data with?</strong></h2>\n<p>Only where necessary will we share your information with selected recipients who have a legal basis and valid jurisdiction to request such data. These categories of recipients include government, public, regulatory, judicial, and law enforcement bodies or authorities: there are circumstances in which we are legally required to disclose information, including to comply with a legal obligation or processes, such as a court order, subpoena or another legal process, to enforce our terms, address issues relating to security or fraud, or protect our users and provided the requesting entity has proper jurisdiction to obtain your personal information.</p>\n<h2><a name=\"_Toc79984740\"></a><a name=\"_Toc80400239\"></a>How can I exercise my rights over my data?</h2>\n<p>Some countries\' laws grant specific rights to users of <a href=\"../\"><strong>Vwanu</strong></a>, which are set out in this section.</p>\n<h3><a name=\"_Toc79984741\"></a><a name=\"_Toc80400240\"></a><strong>USA-SPECIFIC TERMS</strong></h3>\n<ul>\n<li>If you are a user of Vwanu in the United States of America, the below Additional Terms: (a) are incorporated into these Terms; (b) apply to your use of Vwanu; and (c) override the head terms of these Terms to the extent of any inconsistency.</li>\n<li>If you are a user of Vwanu in the United States of America, the following terms expressly replaces the above \"Governing law and dispute resolution\" section of these Terms.</li>\n<li>If you live in (or, if a business, your principal place of business is in) the United States, the laws of the state where you live govern all claims, regardless of conflict of law principles, except that the Federal Arbitration Act governs all provisions relating to arbitration. You and we irrevocably consent to the exclusive jurisdiction and venue of the state or federal courts of California, for all disputes arising out of or relating to these Terms that are heard in court (excluding arbitration).</li>\n</ul>\n<p>EACH OF THE PARTIES HERETO IRREVOCABLY WAIVES ANY AND ALL RIGHT TO TRIAL BY JURY OR TO PARTICIPATE IN A CLASS ACTION IN ANY LEGAL PROCEEDING ARISING OUT OF OR RELATING TO THESE TERMS OR THE TRANSACTIONS CONTEMPLATED HEREBY.</p>\n<p>In the event of a dispute, you and we agree to try for sixty (60) days to resolve it informally. If you and we are unable to come to informal resolution within sixty (60) days, you and we agree to binding individual arbitration before the American Arbitration Association (\"AAA\") under the Federal Arbitration Act (\"FAA\") (with such arbitration to be conducted under the AAA\'s Commercial Arbitration Rules), and not to sue in court in front of a judge or jury. Instead, a neutral arbitrator will decide and the arbitrator\'s decision will be final except for a limited right of appeal under the FAA. Class action lawsuits, class-wide arbitrations, private attorney-general actions, and any other proceeding where someone acts in a representative capacity are not allowed, and nor is combining individual proceedings without the consent of all parties. These Terms govern to the extent they conflict with the AAA\'s Commercial Arbitration Rules or Consumer Arbitration Rules. You and we must file in arbitration any claim or dispute (except intellectual property disputes) within one year from when it first could be filed. If the class action waiver is found to be illegal or unenforceable as to all or some parts of a dispute, then those parts won\'t be arbitrated but will proceed in court, with the rest proceeding in arbitration. If any other provision of these provisions regarding arbitration is found to be illegal or unenforceable, that provision will be severed but the rest of these provisions regarding arbitration still apply.</p>\n<p>If you are a California resident, then (except to the extent prohibited by applicable laws) you agree to waive California Civil Code Section 1542, and any similar provision in any other jurisdiction (if you are a resident of such other jurisdiction), which states: \"A general release does not extend to claims which the creditor does not know or suspect to exist in his favor at the time of executing the release, which, if known by him must have materially affected his settlement with the debtor\".</p>\n<h3><a name=\"_Toc79984742\"></a><a name=\"_Toc80400241\"></a><strong>AUSTRALIA-SPECIFIC TERMS</strong></h3>\n<p>If you are a user of <a href=\"../\"><strong>Vwanu</strong></a> in Australia, the below Additional Terms: (a) are incorporated into these Terms; (b) apply to your use of <a href=\"../\"><strong>Vwanu</strong></a>; and (c) override the head terms of these Terms to the extent of any inconsistency.</p>\n<p>All express or implied guarantees, warranties, representations, or other terms and conditions relating to these Terms or their subject matter, not contained in these Terms, are excluded from these Terms to the maximum extent permitted by applicable laws and regulations.</p>\n<p>Nothing in these Terms excludes, restricts or modifies any guarantee, warranty, term or condition, right or remedy implied or imposed by any applicable laws and regulations which cannot lawfully be excluded, restricted or modified.</p>\n<p>If any guarantee, condition, warranty or term is implied or imposed by any applicable laws and regulations and cannot be excluded (a \"Non-Excludable Provision\"), and we are able to limit your remedy for a breach of the Non-Excludable Provision, then our liability for breach of the Non-Excludable Provision is limited to one or more of the following at our option:</p>\n<ul>\n<li>in the case of goods, the replacement of the goods or the supply of equivalent goods, the repair of the goods, the payment of the cost of replacing the goods or of acquiring equivalent goods, or the payment of the cost of having the goods repaired; or</li>\n<li>in the case of services, the supplying of the services again, or the payment of the cost of having the services supplied again.</li>\n</ul>\n<h2><a name=\"_Toc79984744\"></a><a name=\"_Toc80400242\"></a><strong>Customer Data Processing Appendix:</strong></h2>\n<p><strong>Customer Data</strong>\" means any personal data that <a href=\"../\"><strong>Vwanu</strong></a> processes on behalf of Customer via the Service, as more particularly described in this DPA.</p>\n<p>\"<strong>Data Protection Laws</strong>\" signifies all information protection laws and guidelines appropriate to a gathering\'s handling of Customer Data under the Agreement, including, where pertinent, EU Data Protection Law and Non-EU Data Protection Laws.</p>\n<h2><a name=\"_Toc79984745\"></a><a name=\"_Toc80400243\"></a>GDPR-Eu Data Protection Law</h2>\n<p>\"<strong>EU Data Protection Law</strong>\" signifies all data protection laws and guidelines appropriate to Europe, including (I) Regulation 2016/679 of the European Parliament and the Council on the insurance of ordinary people concerning the preparing of individual information and on the free development of such information <strong>(General Data Protection Regulation)</strong> <strong>(\"GDPR\");</strong> (ii) Directive 2002/58/EC concerning the processing of personal data and the protection of privacy in the electronic communications sector; (iii) applicable national implementations of (i) and (ii); and (iii) in respect of the United Kingdom (\"UK\") any applicable national legislation that replaces or converts in domestic law the GDPR or any other law relating to Data and privacy as a consequence of the UK leaving the European Union).</p>\n<p>\"Europe\" signifies, for the motivations behind this DPA, the European Union, the European Economic Area as well as their part states, Switzerland and the United Kingdom.</p>\n<p>\"Non-EU Data Protection Laws\" means the California Consumer Privacy Act (\"CCPA\"); the Canadian Personal Information Protection and Electronic Documents Act (\"PIPEDA\"); and the Brazilian General Data Protection Law (\"LGPD\"), Federal Law no. 13,709/2018.</p>\n<ul>\n<li><strong>Parties\' roles: </strong>If EU Data Protection Law or the LGPD applies to either party\'s processing of Customer Data, the parties acknowledge and agree that about the processing of Customer Data, Customer is the controller and <a href=\"../\"><strong>Vwanu</strong></a> is a processor acting on behalf of Customer, as further described in Annex A (Details of Data Processing) of this DPA.</li>\n<li><strong>Purpose limitation:</strong> Vwanu shall process Customer Data only following Customers documented lawful instructions as outlined in this DPA, as necessary to comply with applicable law, or as otherwise agreed in writing (\"Permitted Purposes\"). The parties agree that the Agreement sets out the Customers complete and final instructions to Vwanu to processing Customer Data. Processing outside the scope of these instructions (if any) shall require a prior written agreement between the parties.</li>\n<li><strong>Customer compliance:</strong> Customer represents and warrants that (i) it has complied, and will continue to comply, with all applicable laws, including Data Protection Laws, in respect of its processing of Customer Data and any processing instructions it issues to Vwanu; and (ii) it has provided, and will continue to provide, all notice and has obtained, and will continue to obtain, all consents and rights necessary under Data Protection Laws for <a href=\"../\"><strong>Vwanu</strong></a> to process Customer Data for the purposes described in the Agreement. Customer shall have sole responsibility for the accuracy, quality, and legality of Customer Data and how Customer acquired Customer Data. Without prejudice to the generality of the preceding, Customer agrees that it shall be responsible for complying with all laws (including Data Protection Laws) applicable to any emails or other content created, sent, or managed through the Service, including those relating to obtaining consents (where required) to send emails, the content of the emails and its email deployment practices.</li>\n<li><strong>Lawfulness of Customer\'s instructions: </strong>Customer will ensure that <a href=\"../\"><strong>Vwanu</strong></a>s processing of the Customer Data in accordance with Customers instructions will not cause Vwanu to violate any applicable law, regulation, or rule, including, without limitation, Data Protection Laws. Vwanu shall promptly notify Customer in writing, unless prohibited from doing so under EU Data Protection Laws, if it becomes aware or believes that any data processing instruction from Customer violates the GDPR or any UK implementation of the GDPR.</li>\n</ul>\n<h3><a name=\"_Toc79984746\"></a><a name=\"_Toc80400244\"></a><strong>California Online Privacy Protection Act</strong></h3>\n<p>CCPPA is the first state law in the country to require commercial Platforms and online services to create an online privacy policy.</p>\n<p>The laws reach extends well beyond California to require anybody or company in America (and possibly the entire world) that functions Platforms collecting (PII) Personally Identifiable Information from California consumers to create a visible online privacy policy on its Platform declaring the information being accumulated and the individuals or companies with whom it has been distributed. See more at <a href=\"https://consumercal.org/about-cfc/cfc-education-foundation/california-online-privacy-protection-act-caloppa-3/\">https://consumercal.org/about-cfc/cfc-education-foundation/california-online-privacy-protection-act-caloppa-3/</a></p>\n<h3><a name=\"_Toc79984747\"></a><a name=\"_Toc80400245\"></a><strong>According to CalOPPA, we agree to the following:</strong></h3>\n<ul>\n<li>Users can visit our Platform anonymously.</li>\n<li>Once this online privacy policy is established, we will put a link to it on our Platform, on the first significant web page after getting into our Platform.</li>\n<li>Request we disclose to you free of charge the following information covering the 12 months preceding your request:</li>\n<li>The categories of personal information about you that we collected;</li>\n<li>The categories of sources from which the personal information was collected;</li>\n<li>The purpose for collecting personal information about you;</li>\n<li>The categories of third parties to whom we disclosed personal information about you and the categories of personal information that was disclosed (if applicable) and the purpose for disclosing the personal information about you; and</li>\n<li>The specific pieces of personal information we collected about you;</li>\n<li>Our online privacy policy link includes the term privacy and can certainly be on the page given above.</li>\n<li>Youll be notified of any online privacy policy changes:</li>\n<li>Via email</li>\n</ul>\n<h3><a name=\"_Toc79984748\"></a><a name=\"_Toc80400246\"></a><strong>Your Brazilian Privacy Rights</strong></h3>\n<p>If you are located in Brazil, you may learn more about your Brazilian privacy rights. users and others who reside in Brazil (consumers or you). We adopt this notice to comply with the Brazilian Data Protection Law Lei Geral de Proteo de Dados Pessoais (Law No. 13,709/2018) (\"LGPD\"). Any terms defined in the LGPD have the same meaning when used in this notice.</p>\n<h4><strong>LGPD</strong></h4>\n<p>On September 18, 2020, the Lei Geral de Proteo de Dados Pessoais (LGPD) will come into effect for Brazilian residents. The LGPD embraces many of the privacy rights for which we have advocated for years. We want to assure you that we still advocate for those rights and more. For those of you who are located in Brazil, this page will help you understand the LGPD and our compliance with it.</p>\n<p>In addition to the rights outlined in the <a href=\"../\"><strong>Vwanu</strong></a> Privacy Policy, as a user located in Brazil, you may be able to exercise the following rights with respect to your personal information that we have collected, subject to certain limitations:</p>\n<ul>\n<li>The right to confirmation of the existence of the processing. You have the right to ask that we confirm whether we process your personal data.</li>\n<li>The right to access the data. You have the right to access the personal Data we hold about you and certain information about how we use it and who we share it with, including information about any public and private entities we have shared your personal data with. Most of this Data can be reviewed in your account panel and related content and services that you have purchased.</li>\n<li>The right to correct incomplete, inaccurate or out-of-date data. If you want to correct or revise any of the data, we retain on you, you may do so by accessing your account and the information contained within it. This includes Who is information collected for domains that you have purchased.</li>\n<li>The right to anonymize, block, or delete unnecessary or excessive data or data that is not being processed in compliance with the LGPD. Please note that, depending on the request, this may result in a suspension or discontinuation of certain services and is also governed by legal and/or contractual retention guidelines.</li>\n<li>The right to the portability of data to another service provider, by means of an express request. We provide you with the ability to move any of your account data to a third party, at any time.</li>\n<li>The right to delete personal data processed with the consent of the data subject. You have a right to request the permanent deletion of your data, subject to certain exceptions. However, please note that exercising this right may result in a suspension or discontinuation of services and is also governed by legal and/or contractual retention guidelines.</li>\n<li>The right to information about the possibility of not giving consent and about the consequences of the refusal. You have the right to ask us to provide information about the possibility of not giving consent for the processing of your personal data and the consequences of such refusal.</li>\n<li>The right to revoke consent.</li>\n</ul>\n<p>Please note that not all of these rights listed above are absolute, and limitations/exceptions apply in some cases. For example, we may not be able to fully comply with your request if we are bound by certain legal restrictions or contractual requirements, but in those circumstances, we will still respond to notify you of such a decision.</p>\n<h5><strong>Exercising Data Portability and Deletion Rights</strong></h5>\n<p>To exercise the data portability and deletion rights described above, please submit a verifiable consumer request to us by:</p>\n<ul>\n<li>You can contact us Contact Us</li>\n<li>We will need to verify your identity before processing your request. The verifiable consumer request must:</li>\n<li>Provide sufficient information that allows us to reasonably verify you are the person about whom we collected personal information or a legal representative.</li>\n<li>Describe your request with sufficient detail that allows us to properly understand, evaluate and respond to it.</li>\n</ul>\n<p>We cannot respond to your request or provide you with personal information if we cannot verify your identity or authority to make the request and confirm the personal information relates to you. Making a verifiable consumer request does not require you to create an account with us. We will only use personal information provided in a verifiable consumer request to verify the requestor\'s identity or authority to make the request.</p>\n<h3><a name=\"_Toc79984749\"></a><a name=\"_Toc80400247\"></a><strong>How does our Platform handle Do Not Track signals?</strong></h3>\n<p>We honor USUALLY DO NOT Track signals and dont Track, place cookies, or use advertising whenever a Do Not Track (DNT) browser method is set up.</p>\n<h3><a name=\"_Toc79984750\"></a><a name=\"_Toc80400248\"></a><strong>COPPA (Children Online Privacy Protection Action)</strong></h3>\n<p>With regards to the assortment of private information from children under age 13 years, the Childrens Online Privacy Protection Act (COPPA) puts parents in charge. The Federal Trade Commission, United States consumer safety firm, enforces the COPPA Guideline, which spells out what providers of Platforms and online services should do to safeguard children privatizes and security online.</p>\n<h3><a name=\"_Toc79984751\"></a><a name=\"_Toc80400249\"></a><strong>Fair Information Practices</strong></h3>\n<p>The fair Information Practices Rules form the backbone of level of privacy law and the ideas they include have played an important role in the introduction of data protection laws and regulations around the world. Understanding the Good Information Practice Guidelines and how they must be implemented is fundamental to adhere to the various privation laws and regulations that protect private information.</p>\n<p><strong><em>To become consistent with Fair Information Methods we will need the following responsive action, should a data breach happen:</em></strong></p>\n<ul>\n<li>We will inform you via email</li>\n<li>within 7 business days</li>\n<li>We will inform the users via in-Platform notification</li>\n<li>Within 1 working day</li>\n</ul>\n<p>We also agree to the average person Redress Rule which requires that peoples have the right to legally go after enforceable privileges against data collectors and processors who neglect to adhere to the law. This theory requires not just that people have enforceable protection under the law against data users, but also that person have recourse to courts or federal government agencies to research and/or prosecute non-compliance by data processors.</p>\n<h3><a name=\"_Toc79984752\"></a><a name=\"_Toc80400250\"></a><strong>CAN-SPAM Act</strong></h3>\n<p>The CAN-SPAM Take action is a regulation that sets the guidelines for commercial email, establishes requirements for commercial announcements, offers recipients to have emails ceased from being delivered to them, and spells out hard fines for violations.</p>\n<h3><a name=\"_Toc79984753\"></a><a name=\"_Toc80400251\"></a>We accumulate your email to be able to:</h3>\n<ul>\n<li>Send information, react to questions, and/or other demands or questions</li>\n<li>To maintain compliance with CANSPAM, we consent to the next:</li>\n<li>Not use untrue or misleading subject matter or email addresses.</li>\n<li>Identify the concept as an advertisement in some realistic way.</li>\n<li>Include the physical address of our Platform headquarters or business</li>\n<li>Screen third-party email marketing services for conformity, if one can be used.</li>\n<li>Honor opt-out/unsubscribe demands quickly.</li>\n<li>Allow users to unsubscribe utilizing the link at the bottom of every email.</li>\n<li>If anytime you want to unsubscribe from receiving future email, you can email us at by using contact form at our Platform <a href=\"../\"><strong>Vwanu</strong></a> and well immediately remove you from ALL communication.</li>\n</ul>\n<h2><a name=\"_Toc79984754\"></a><a name=\"_Toc80400252\"></a><strong>How do we protect your details?</strong></h2>\n<ul>\n<li>We do not use vulnerability scanning and/or scanning to PCI specifications.</li>\n<li>We only provide articles and information. We never require credit card volumes.</li>\n<li>We use regular Malware Scanning.</li>\n<li>Your individual information is comprised behind secured systems and is merely accessible by a restricted number of folks whove special access privileges to such systems, and must keep carefully the information confidential. Furthermore, all very sensitive/credit information you resource is encrypted via Secure Socket Layer (SSL) technology.</li>\n<li>We implement a number of security measures whenever a user gets into, submits, or accesses their information to keep up the protection of your individual information.</li>\n</ul>\n<p>All deals are processed through the gateway service provider and arent stored or refined on our machines.</p>\n<h2><a name=\"_Toc79984755\"></a><a name=\"_Toc80400253\"></a><strong>Do we use cookies?</strong></h2>\n<p>Yes. Cookies are small documents a Platform or its provider exchanges to your computers hard drive through your Browser (if you allow) that permits the Platforms or service providers systems to identify your internet browser and capture please remember certain information. For example, we use cookies to help us keep in mind and process the things in your shopping cart software. Also, they are used to help us understand your requirements based on prior or current Platform activity, which permits us to offer you improved upon services. We also use cookies to help us put together aggregate data about Platform traffic and Platform conversation so that people may offer better Platform experience and tools in the foreseeable future.</p>\n<h3><a name=\"_Toc79984756\"></a><a name=\"_Toc80400254\"></a><strong>We use cookies to:</strong></h3>\n<ul>\n<li>Understand and save users tastes for future views or visits of our Website.</li>\n<li>Keep an eye on advertisements.</li>\n<li>Compile aggregate data about Website traffic and Website connections in order to provide better Website activities and tools in the foreseeable future.</li>\n<li>We also use third party advertisements on <a href=\"../\"><strong>Vwanu</strong></a> to support our Website. Some of these advertisers may use technology such as cookies and web beacons when they advertise on our Website, which will also send these advertisers (such as Google through the Google AdSense program) information including your IP address, your ISP, the browser you used to visit our Website, and in some cases, whether you have Flash installed. This is generally used for geotargeting purposes (Serving Online Booking ads to Travelers) or showing certain ads based on specific Websites visited (such as showing marketing ads to someone who frequents marketing Websites or blogs).</li>\n<li><em>We might also use third-party services that monitor these details on our behalf.</em></li>\n</ul>\n<p>You are able to choose that your personal computer warns you whenever a cookie has been directed, or you can select to carefully turn off all cookies. You can perform that through your web browser settings. Since internet browser is just a little different, check out your browsers Help Menu to learn the way in which to change your cookies.</p>\n<p>If you change cookies off, a number of the features that produce your Website experience better might not exactly function properly. It will not have an impact on the users experience that produces your Website experience better and might not exactly function properly.</p>\n<h2><a name=\"_Toc79984757\"></a><a name=\"_Toc80400255\"></a><strong>Limitation of Liability</strong></h2>\n<ul>\n<li>Some jurisdictions do not allow the limitation or exclusion of liability for incidental or consequential damages so some of the above limitations may not apply to you.</li>\n<li>We make no legal representation that the Website or services are appropriate or available for use in locations outside UNITED STATES. You may access the Website from outside UNITED STATES.at your own risk and initiative and must bear all responsibility for compliance with any applicable foreign laws.</li>\n</ul>\n<h3><a name=\"_Toc79984758\"></a><a name=\"_Toc80400256\"></a><strong>Indemnification</strong></h3>\n<ul>\n<li>Upon visiting this Website you agree release, indemnify, defend and hold harmless <a href=\"../\"><strong>Vwanu</strong></a> and any of its contractors, agents, employees, officers, directors, shareholders, affiliates and assigns from all liabilities, claims, damages, costs and expenses, including reasonable attorneys fees and expenses, of third parties relating to or arising out of your use of the Website content; your use of the services; your violation of any provision of these terms; any unauthorized information or data you supplied to us. You will have sole responsibility to defend us against any claim, but you must receive our prior written consent regarding any related settlement.</li>\n</ul>\n<h3><a name=\"_Toc79984759\"></a><a name=\"_Toc80400257\"></a><strong>Governing Law and Jurisdiction</strong></h3>\n<ul>\n<li>This Website originates from the UNITED STATES. The laws of UNITED STATES. Without regard to its conflict of law, principles will govern these terms to the contrary. You, hereby agree that, all disputes arising out of or in connection with these terms shall be submitted to the exclusive jurisdiction of the UNITED STATES. By using this Website, you consent to the jurisdiction and venue of such courts in connection with any action, suit, proceeding or claim arising under or by reason of these terms. You now waive any right to trial by jury arising out of these terms.</li>\n</ul>\n<h2><a name=\"_Toc79984760\"></a><a name=\"_Toc80400258\"></a><strong>Changes to This Privacy Notice</strong></h2>\n<p>We reserve the right to alter this privacy notice at any time. Such alterations will be posted on our website. You can also obtain an up-to-date copy of our privacy notice by contacting us.</p>\n<h2><a name=\"_Toc79984761\"></a><a name=\"_Toc80400259\"></a><strong>Contacting Us</strong></h2>\n<p>If you would like to contact us to understand more about this Policy or wish to contact us concerning any matter relating to individual rights and your Personal Information, you may email us at <a href=\"mailto:info@vwanu.com\">info@vwanu.com</a></p>\n<p></p>\n<p><a href=\"../\"><strong>Vwanu</strong></a></p>\n<p><a href=\"mailto:info@vwanu.com\">info@vwanu.com</a></p>\n<p>United States</p>\n<p></p>\n<p>This document was last updated on August 20, 2021</p>\n<p></p>\n<p></p>\n<p></p>\n<p></p>'),
